import React, { Component } from 'react';
import './App.css';

function Blog(props){
  return (
    <div className="col-6 text-center mb-2">
      <div className="card">
        <img className="img-\" src={props.linkAnh} />
        <div className="card-body">
          <h1> { props.tieuDe } </h1>
          <p> { props.content } </p>
        </div>
      </div>

    </div>
  )
}


function App() {
  return (
    <div className="App">
      <div className="container py-5">
        <div className="row">

          <Blog tieuDe="This is blog one!" content="This is content of blog one!" linkAnh="https://media.ngoisao.vn/news/2015/09/06/canh-canh-nam-than-showbiz-1resize-ngoisao.vn.stamp2.jpg" />


        </div>
      </div>
    </div>
  );
}

export default App;
